import React, { useState } from "react";
import './Dashboard.css';
import axios from "axios";

function Dashboard(){
    const username = sessionStorage.getItem("username");
    //const userID = sessionStorage.getItem("userID");
    const [msg,setMsg] = useState("");
    const [dataSetArr,setData] = useState();
    
    const getItems = () => fetch('http://localhost:6021/GetData').then(res => res.json());
    useEffect(() => {
        getItems().then(data => setData(data.data));
    }, []);
  
    console.log(dataSetArr);  
return(
       <>
            <nav className="navbar navbar-inverse">
                <div className="container-fluid">
                     <div className="navbar-header">
                         <a className="navbar-brand title">MedApp</a>
                     </div>
                    <ul className="nav navbar-nav navbar-right">
                       <li><a className="list" href="#"><span className="glyphicon glyphicon-user"></span>Hi, {username}</a></li>
                    </ul>
                </div>
            </nav>
            <p className="NoData">{msg}</p> 
            <div className="container-fluid">
               <div className="row">
               {dataSetArr.map(((item) => (
                   <div className="col-sm-4">
                      <p>{item.itemName}</p>
                      <i className="fa fa-rupee"> </i><span>{item.minPrice}</span>
                      <button className="btn btn-sm btn-default btn_css">Add Cart</button>
                   </div>
                   )))}
               </div>
            </div>
       </>
   );
}
export default Dashboard;
